import  {Link} from 'react-router-dom';
import logo from '../logo.jpg';

export default function Navbar() {

        return (
            <nav className='navbar navbar-expand-sm navbar-dark px-sm-5'>
         <img src={logo} width ='20px'  alt='store' />
            </nav>
        );
    
    }
